import React from 'react'

const userAvatar = ({isLoggedin, user}) => {
  return (

        isLoggedin ?( 
        <div class="flex -space-x-1 overflow-hidden">
          {user.profile_image ?( 
            <img class="inline-block h-6 w-6 rounded-full ring-2 ring-white" src={user.profile_image} alt={user.username}/>
            ):(<img class="inline-block h-6 w-6 rounded-full ring-2 ring-white" src={user.profile_image} alt={user.username}/>
          )}
        </div>):( 
        <a href='/login' 
           className="px-4 py-2 mt-2 text-sm font-semibold text-gray-900 bg-transparent rounded-lg dark-mode:bg-gray-700 dark-mode:hover:bg-gray-600 dark-mode:focus:bg-gray-600 dark-mode:focus:text-white dark-mode:hover:text-white dark-mode:text-gray-200 md:mt-0 hover:text-gray-900 focus:text-gray-900 hover:bg-gray-200 focus:bg-gray-200 focus:outline-none focus:shadow-outline">
            Login
        </a> )
  )
}

export default userAvatar
